import logo from './assets/logo.png';
import './App.css';

export default function App() {
  return (
    <div className='App container'>
      <Nav>
        <div className='mainContent'>
          <img src={logo} alt='web logo' />
        </div>
        <div>
          <Button variant='info'>
            <NavItem>Register</NavItem>
          </Button>
          <Button variant='info'>
            <NavItem>Login</NavItem>
          </Button>
        </div>
